import React, { useState } from 'react';
import axios from 'axios';
import './Up.css';

function Upload() {
  const [formData, setFormData] = useState({
    title: "",
    members: "",
    mentor: "",
    domain: "", // Add domain, college, university, and department fields
    subject: "",
    department: "",
    college: "",
    university: "",
  });

  const engineeringDomains = [
    "IOT",
    "Machine Learning",
    "Artificial Intelligence",
    "Data Science",
    "Robotics",
    "Computer Vision",
    "Cybersecurity",
    "Cloud Computing",
    "Big Data",
    "Software Engineering",
  ];

  const colleges = [
    "College 1",
    "College 2",
    "College 3",
    "College 4",
    "College 5",
  ];

  const universities = [
    "University 1",
    "University 2",
    "University 3",
    "University 4",
    "University 5",
  ];

  const departments = [
    "Computer Science",
    "Electrical Engineering",
    "Mechanical Engineering",
    "Civil Engineering",
    "Electronics and Communication",
    "Information Technology",
    "Chemical Engineering",
    "Biotechnology",
    "Aerospace Engineering",
    "Environmental Engineering",
  ];

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div className='inpu1'>
      <h1 className="hh1">File Upload</h1>
      <div className='inp2'>
      </div>
      <div className='inputform1'>
        <label className="lb1">Title</label>
        <input
          className="inpu111"
          type="text"
          placeholder="Enter Title"
          name="title"
          value={formData.title}
          onChange={handleChange}
        />
        <label className="lb1">Members</label>
        <input
          className="inpu111"
          type="text"
          placeholder="Enter Members"
          name="members"
          value={formData.members}
          onChange={handleChange}
        />
        <label className="lb1">Mentor</label>
        <input
          className="inpu111"
          type="text"
          placeholder="Enter Mentor"
          name="mentor"
          value={formData.mentor}
          onChange={handleChange}
        />
        <label className="lb1">Domain</label>
        <select
          className="inpu111"
          name="domain"
          value={formData.domain}
          onChange={handleChange}
        >
          <option value="" disabled>Select Domain</option>
          {engineeringDomains.map((domain, index) => (
            <option key={index} value={domain}>
              {domain}
            </option>
          ))}
        </select>
        <label className="lb1">Subject</label>
        <input
          className="inpu111"
          type="text"
          placeholder="Enter Subject"
          name="subject"
          value={formData.subject}
          onChange={handleChange}
        />
        <label className="lb1">Department</label>
        <select
          className="inpu111"
          name="department"
          value={formData.department}
          onChange={handleChange}
        >
          <option value="" disabled>Select Department</option>
          {departments.map((department, index) => (
            <option key={index} value={department}>
              {department}
            </option>
          ))}
        </select>
        <label className="lb1">College</label>
        <select
          className="inpu111"
          name="college"
          value={formData.college}
          onChange={handleChange}
        >
          <option value="" disabled>Select College</option>
          {colleges.map((college, index) => (
            <option key={index} value={college}>
              {college}
            </option>
          ))}
        </select>
        <label className="lb1">University</label>
        <select
          className="inpu111"
          name="university"
          value={formData.university}
          onChange={handleChange}
        >
          <option value="" disabled>Select University</option>
          {universities.map((university, index) => (
            <option key={index} value={university}>
              {university}
            </option>
          ))}
        </select>
      </div>
      <div className="upload-container">
        <input type="name" placeholder='Enter Your Abstract Here..' className='inpp1'></input>
        <button className="upload1">
          Check For Plagiarism
        </button>
        <h1>Upload Report here</h1>
        <input
          type="file"
          accept=".pdf, .doc, .docx"
          className='inpp2'
        /><br/>
        <button className="upload-button">
          Upload
        </button>
      </div>
    </div>
  );
}

export default Upload;
